      ],
    },
    {
      toptitle: "Today(01)",
      cat1: [
        {
          userImg: CardIconImg2,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
      ],
    },
  ];
  const DummyData3 = [
    {
      toptitle: "TEST",
      cat1: [
        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
        {
          userImg: CardIconImg2,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
