          DOB: "Printer:INR 2400",
          link: "/",
        },
        {
          userImg: CardIconImg,
          name: "Sonali Bhagat",
          DOB: "Printer:INR 2400",
          link: "/",
        },
      ],
    },
  ];
  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />

        <div className="row g-4">
          <InfoCard />
          <EmployeesChart />
          <WorkingFormatChart />
          <WhoAwayApp />
          <CelebrationsApp />
          <HolidaysApp />
          <CalendarApp />
        </div>
        <PagesTopTitle title="Request for Approvals" />
        <div className="row g-4">
          <DashboardCard data={DummyData} title="test" />
          <DashboardCard data={DummyData2} />
          <DashboardCard data={DummyData3} />
        </div>
      </div>
    </>
  );
};

export default Dashboard;
